import React from "react";
import {formatDate} from "../../../formatDate";
import './OrderShedule.css'

const OrderShedule = (props) => {
    return (
        <>
            <div className="orderSheduleContainer">
                {props.aaaa.map(i => <div style={{display: "flex", width: '100%'}}>
                    <div className="element">{i.froms}</div>
                    <div className="borderElement">{i.to}</div>
                    <div className="element">{formatDate(new Date(i.date))}</div>
                    <div className="borderElement">{i.price} Ñ€.</div>
                    <div className="element">dsds</div>
                </div>)}
            </div>
        </>
    )
}

export default OrderShedule;
